package wipro_java;

public class Comparisonoperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 5;
		int y = 6;
		System.out.println(x == y);
		System.out.println(x != y);
		
		System.out.println(x < y);
		System.out.println(x > y);
		
		System.out.println(x <= y);
		System.out.println(x >= y);

	}

}
